import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { DialogContent, DialogTitle, Dialog, Button, Typography, Container, Grid, TextField } from '@mui/material';

function ViewNominee({ id, onClose }) {
    const [nominee, setNominee] = useState(null);
    const navigate = useNavigate();

    useEffect(() => {
        axios.get(`http://127.0.0.1:5000/nominee/${id}/info`)
            .then(response => {
                setNominee(response.data);
            })
            .catch(error => {
                console.error('Error fetching nominee details:', error);
                navigate('/'); // Redirect if the fetch fails
            });
    }, [id, navigate]);

    if (!nominee) {
        return <DialogContent><Typography>Loading...</Typography></DialogContent>;
    }

    return (
        <Dialog open onClose={onClose} maxWidth="md" fullWidth>
            <DialogTitle>Nominee Details</DialogTitle>
            <DialogContent dividers>
                <Container>
                    <Grid container spacing={2}>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="First Name"
                                value={nominee.first_name}
                                fullWidth
                                InputProps={{ readOnly: true }}
                                variant="outlined"
                                margin="normal"
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Last Name"
                                value={nominee.last_name}
                                fullWidth
                                InputProps={{ readOnly: true }}
                                variant="outlined"
                                margin="normal"
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Department"
                                value={nominee.department_name}
                                fullWidth
                                InputProps={{ readOnly: true }}
                                variant="outlined"
                                margin="normal"
                            />
                        </Grid>
                        <Grid item xs={12} sm={6}>
                            <TextField
                                label="Job Category"
                                value={nominee.job_category}
                                fullWidth
                                InputProps={{ readOnly: true }}
                                variant="outlined"
                                margin="normal"
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                label="Email"
                                value={nominee.email}
                                fullWidth
                                InputProps={{ readOnly: true }}
                                variant="outlined"
                                margin="normal"
                            />
                        </Grid>
                        <Grid item xs={12}>
                            <TextField
                                label="Nominator Qualification"
                                value={nominee.nominator_qualification}
                                fullWidth
                                multiline
                                InputProps={{ readOnly: true }}
                                variant="outlined"
                                margin="normal"
                            />
                        </Grid>
                        {/* Education History */}
                        <Grid item xs={12}>
                            <Typography variant="h6">Educational History:</Typography>
                            {nominee.educations && nominee.educations.map((education, index) => (
                                <TextField
                                    key={index}
                                    label={`Education ${index + 1}`}
                                    value={`${education.degree} in ${education.program} from ${education.college_name}, ${education.location} (${education.graduation_year})`}
                                    fullWidth
                                    InputProps={{ readOnly: true }}
                                    variant="outlined"
                                    margin="normal"
                                />
                            ))}
                        </Grid>
                    </Grid>
                    <Button
                        variant="contained"
                        color="primary"
                        onClick={onClose}
                        style={{ marginTop: '20px' }}
                    >
                        Close
                    </Button>
                </Container>
            </DialogContent>
        </Dialog>
    );
}

export default ViewNominee;
